if mibBuilder.loadTexts: mscBtdsServiceFailureReason.setDescription('This attribute indicates the result of end to end negotiation with the remote end across the subnet. If serviceFailureReason is undetermined, this Btds has not performed end to end negotiation with the remote end, and may or may not be up. serviceFailureReason is undetermined if this Btds just became enabled, if there is not enough available bandwidth to perform negotiation or if the remote end cannot perform negotiation with this Btds. If serviceFailureReason is none, end to end negotiation passed. If serviceFailureReason is mismatchedService, end to end negotiation failed because the remote end service is not a Btds. If serviceFailureReason is mismatchedTimeSlotAlignment, end to end negotiation failed because the local Btds Framer timeSlotAlignment does not match the remote Btds Framer timeSlotAlignment. If serviceFailureReason is mismatchedCallDiscriminator, the local Btds call discrimination subcomponents (Btds Mcdn and Btds Dpnss1) do not match the remote Btds call discrimination subcomponents. If serviceFailureReason is compDecodeFailed, end to end negotiation failed because the information received from the remote end was not recognized as valid data. Description of bits: none(0) undetermined(1) logicalConnection(2) mismatchedService(3) mismatchedTimeSlotAlignment(4) mismatchedCallDiscriminator(5) notused6(6) notused7(7) notused8(8) notused9(9) notused10(10) notused11(11) notused12(12) notused13(13) compDecodeFailed(14)')
