if mibBuilder.loadTexts: mscBtdsFramerProtocol.setDescription('This attribute specifies the ingress frames suppressed by this Btds. If protocol is none, this Btds does not suppress any ingress frames. If protocol is hdlc, this Btds suppresses ingress frames where each byte is an identical non-inverted hdlc idle pattern, but only after two or more consecutive frames meet this description. If protocol is nrziHdlc, this Btds suppresses ingress frames where each byte is an identical NRZI encoded hdlc idle pattern, but only after two or more consecutive frames meet this description. If protocol is universal, this Btds suppresses ingress frames where each 16-bit word is identical, but only after a provisionable number of consecutive frames meet this description. The number of consecutive frames is determined by numOfIdleBytesToMonitor. Note that the number of idle bytes suppressed at the ingress side does not necessarily equal the number of idle bytes generated at the egress side. It is a semantic check warning if protocol is hdlc, nrziHdlc or universal and this Btds is running on a 1pE1Mvp, 1pDS1Mvp or 1pTTC2mMvp card.')
