if mibBuilder.loadTexts: mscBtdsFramerTimeSlotAlignment.setDescription('This attribute specifies the time slot alignment of this Btds. With time slot alignment, data sent out on a particular time slot to a link is received on the same time slot. A value of unaligned specifies the regular Btds application. A value of frameAligned enables frame aligned Btds. When framed aligned Btds is specified, only one channel may be provisioned since only one fraction of N x 64 kbit/s is presently available. timeSlotAlignment can not be set to frameAligned unless this Btds is running on a DS1V, E1V, 1pDS1V or 1pE1V card timeSlotAlignment must have the same value at both ends of a Btds. If timeSlotAlignment does not have the same value at both ends of a Btds, the Btds will be out of service. In this case, Btds serviceFailureReason is mismatchedTimeSlotAlignment.')
mscBtdsFramerInsertedOutputDelay = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 2, 11, 1, 11), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 50)).clone(12)).setMaxAccess("readwrite")
