if mibBuilder.loadTexts: mscBtdsFramerInsertedOutputDelay.setDescription('This attribute defines the amount of added output delay to compensate for cross network delay variations. Cross network delay variations is a function of the network topology. Settingthis attribute will allow the Btds service to deal with cross network delay variations. This attribute provides for delay in addition to the elastic buffer. Total egress delay is approximately the insertedOutputDelayplus the elastic buffer. The elastic buffer is the packetization timex5 cells in the buffer. Packetization time per cell is calculated by taking the inverse of [linespeed(kbits/sec) x (byte/8bits) x (1/cellsize (bytes))]. This value is msec.The value for insertedOutputDelay should be increased if the frmUnderRuns is increasing and frmLostInNetwork is not increasing.')
mscBtdsFramerBtdsCellSize = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 2, 11, 1, 12), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("n44", 0), ("n84", 1))).clone('n44')).setMaxAccess("readwrite")
