if mibBuilder.loadTexts: mscBtdsPlcRemoteName.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcRemoteName.setDescription("This attribute is the PLC's remote end point's address in the format of a Passport component name. The syntax of a component is: 'em/node type/instance'. For an alternative representation of end point's addresses, see addressToCall and localAddress PLC attributes. When using Passport component name representation, end points are identified using a node name and a service name. As an example, the end point component for a third Btds service on node MoonBase is: 'EM/MoonBase BTDS/3'. If the remoteName is provisioned, it must match the name of the remote end or the connection will not be established even if the remote end is provisioned correctly. If no remoteName is provisioned, then this LC will accept connections from any other remote LC and it will not originate calls. Connections establish faster and are unique if both ends are provisioned with remoteName. RemoteName should be used when the remote end of the connection resides within the same topology region. If it resides in a different topology region, then addressToCall and localAddress PLC attributes should be used. When both remoteName and addressToCall are provisioned, addressToCall takes precedence. That is, connection will be established to the service specified by addressToCall. These strings are case insensitive, but the complete component name must be input.")
mscBtdsPlcSetupPriority = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 3), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 4)).clone(2)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcSetupPriority.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcSetupPriority.setDescription("This attribute gives the priority at which a path is established. Zero is the highest priority and four is the lowest. When PORS establishes a path through the network, it uses the setupPriority attribute to determine its potential for bumping established paths to acquire their bandwidth. The holdingPriority, a complementary attribute of this attribute, indicates the priority a path maintains once it is established. A new path can bump an existing path if the new path's setupPriority is higher (numerically less) than the existing path's holdingPriority.")
mscBtdsPlcHoldingPriority = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 4), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 4)).clone(2)).setMaxAccess("readwrite")
