mscBtdsPlcRequiredSecurity = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 9), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 7)).clone(4)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcRequiredSecurity.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcRequiredSecurity.setDescription("This attribute indicates the required minimum level of security of the trunks on the route. Zero represents the most secure and seven represents the least secure. The trunk's security is indicated by the trunkSecurity attribute of the Trunk component, and has values identical in range and meaning to the requiredSecurity attribute. PORS ensures that any route selected does not contain a trunk whose trunkSecurity attribute is numerically greater than the requiredSecurity.")
mscBtdsPlcRequiredCustomerParm = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 10), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 7)).clone(4)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcRequiredCustomerParm.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcRequiredCustomerParm.setDescription('This attribute indicates the allowed customer defined parameter of the trunks on the route. Its value, a number from zero to seven, is chosen by network administration to have a meaning specific to their network, thus allowing them to customize the use of their trunks. A complementary trunk attribute, customerParameter, also has a value from zero to seven. The route selection process does not consider trunks whose customerParameter is greater than the requiredCustomerParameter of the path.')
mscBtdsPlcPathAttributeToMinimize = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 11), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("cost", 0), ("delay", 1))).clone('cost')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcPathAttributeToMinimize.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcPathAttributeToMinimize.setDescription('This attribute indicates whether a route is selected on the basis of minimizing the cost or the delay. Each trunk has a cost and a delay metric associated with it. The cost of a selected route is the sum of the trunk cost metrics for all trunks included in the route. The delay of a selected route is the sum of the trunk delay metric for all trunks included in the route.')
mscBtdsPlcMaximumAcceptableCost = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 12), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535)).clone(1280)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcMaximumAcceptableCost.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcMaximumAcceptableCost.setDescription('This attribute indicates an upper bound on the cost metric of a route, which is the sum of the cost metrics of all trunks on the route. The cost metric is the trunkCost attribute of the Trunk component. If for any trunk the trunkCost is larger than the maximumAcceptableCost, then that trunk is not considered during the route selection. While a shortest route is being selected, the route cost is being compared with the maximumAcceptableCost attribute, and this is done for any minimization criterion. No route is selected if the cost metric of the shortest route is larger than the maximumAcceptableCost.')
mscBtdsPlcMaximumAcceptableDelay = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 13), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 100000)).clone(100000)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcMaximumAcceptableDelay.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcMaximumAcceptableDelay.setDescription("This attribute indicates an upper bound on the delay of a route, which is the sum of the delay of all trunks on the route. It should be provisioned with a reasonable maximum acceptable delay for the end to end one way delay of a 512-byte packet. Remember, that the trunk during its staging measures a measuredRoundTripDelay. This delay is divided by two and truncated to an integer number of milliseconds to provide a one way delay which is used to populate the delay in this trunk object in the topological database. The value includes emission, propagation, and queuing delays. A 512-byte packet is used to perform the measurement. If for any trunk the half of the trunk's measuredRoundTripDelay is larger than the maximumAcceptableDelay, then that trunk is not considered during the route selection. While a shortest route is being selected, the route delay is being compared with the maximumAcceptableDelay attribute, and this is done for any minimization criterion. No route is selected if the delay metric of the shortest route is larger than the maximumAcceptableDelay.")
mscBtdsPlcEmissionPriority = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 14), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 2))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcEmissionPriority.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcEmissionPriority.setDescription('This attribute indicates the urgency with which packets on the path are emitted by the trunks on the route. EmissionPriority of Zero(0) indicates the highest emission priority, while two (2) indicates the lowest emission priority. Packets with a higher emissionPriority (or numerically less) are serviced and sent out before the packets of lower emissionPriority (or numerically higher).')
mscBtdsPlcDiscardPriority = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 15), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(1, 3)).clone(1)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcDiscardPriority.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcDiscardPriority.setDescription('This attribute indicates the importance of the packets on the path. One is used for paths carrying the most important traffic, and three is used for paths carrying the least important traffic. Packets with lower discardPriority(numerically lower) are discarded after packets with a higher discardPriority(numerically higher).')
mscBtdsPlcPathType = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 16), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2))).clone(namedValues=NamedValues(("normal", 0), ("manual", 1), ("forced", 2))).clone('normal')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcPathType.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcPathType.setDescription('This attribute specifies if the path for this PLC is determined automatically or by static provisioning. The default (normal) is to automatically choose a route with Route Selection. Normal pathTypes require less provisioning and can dynamically handle path failures. The other pathTypes are both manual pathTypes where the operator must specify, through provisioning, a static route termed the manualPath. A manual pathType connection is nearly identical to a normal path type connection with the exception that the route is pre-provisioned. For a manual pathType, bandwidth reservations are respected along the path exactly as in a normal path. The last type, the forced pathType, is also a manual path but regardless of the bandwidth available the route is granted provided the trunks are operational and there are sufficient Logical Channels (LChs). The forced pathType could result in over committing the reserved bandwidth allowed on a trunk. A better way to achieve the effects of a forced pathType is to use a manual pathType with setupPriority = 0 and holdingPriority = 0. In this manner the path will reserve correct bandwidth and it will bump other paths if required while not being bumped itself.')
mscBtdsPlcPathFailureAction = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 17), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("disconnectConnection", 0), ("reRoutePath", 1))).clone('reRoutePath')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcPathFailureAction.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcPathFailureAction.setDescription('This attribute is used to specify whether the application can tolerate momentary interruption of a path while a new path is selected. If disconnectConnection is chosen, the application is informed as soon as possible about a failure by disconnection. If the attribute is set to reRoutePath, the path may attempt an immediate reroute, provided the failure is a recoverable failure. If rerouting fails the application is informed of the failure. With this option set to reRoutePath the LCo may wait up to 30 seconds before informing the service of complete disconnection in order to allow both ends to attempt to reconnect. Note that if PLC components are different at both ends only the calling end is allowed to reconnect. All pathTypes respect this attribute. Also on a manualPath with both ends provisioned with independent paths (at least with respect to the failure) this option will have the desired effect that the path is rerouted without complete disconnection at both ends.')
mscBtdsPlcBumpPreference = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 18), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("bumpWhenNecessary", 0), ("bumpToObtainBestRoute", 1))).clone('bumpWhenNecessary')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcBumpPreference.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcBumpPreference.setDescription('This attribute controls when bumping occurs in the route selection process. A connection with higher (numerically less) setupPriority may bump a connection with lower (numerically higher) holdingPriority in order to acquire its bandwidth and be established. By default, bumping occurs only when it is necessary. That is, a connection will bump another connection only if there is no other way for the connection to be established. A connection may be set to always bump in order to find the best route it may have.')
mscBtdsPlcOptimization = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 19), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("disabled", 0), ("enabled", 1))).clone('enabled')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcOptimization.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcOptimization.setDescription('This attribute is used to specify whether this connection should attempt to optimize its path when requested by the routing PORS component. Every path is as optimal as it can be when it is established, but as network traffic patterns and configurations change this path may no longer be as optimal as it could be. The PORS connection manager on a module requests circuits to optimize at the optimization interval.')
mscBtdsPlcAddressToCall = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 20), AsciiString().subtype(subtypeSpec=ValueSizeConstraint(0, 40)).clone(hexValue="")).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcAddressToCall.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcAddressToCall.setDescription("This attribute is the PLC's remote end point's address in the format of a NSAP address. As such it must consist of a string of hex digits although not all 40 digits must be specified. For an alternative representation of end point's addresses, see romoteName attribute. If the addressToCall is provisioned, it must match localAddress provisioned on the remote end or the connection will not be established. Connections establish faster and are unique if both ends are provisioned with addressToCall. AddressToCall must be used when the romote end of the connection resides in different topology region. If it resides in the same topology region, then romoteName may be used. When both remoteName and addressToCall are provisioned, addressToCall takes precedence. That is, connection will be established to the service specified by addressToCall.")
mscBtdsPlcLocalAddress = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 21), AsciiString().subtype(subtypeSpec=ValueSizeConstraint(0, 40)).clone(hexValue="")).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcLocalAddress.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcLocalAddress.setDescription("This attribute is the PLC's end point address in the format of an NSAP address. As such it must consist of a string of hex digits although not all 40 digits must be specified. LocalAddress must share a prefix with MOD nodePrefix or one of MOD alternatePorsPrefixes for this node, otherwise PORS will not be able to route calls to this service. LocalAddress is used in conjunction with addressToCall. That is, the end responsible for originating calls must have addressToCall provisioned, while the end responsible for terminationg calls must have localAddress provisioned. In such a case, addressToCall on the originating end must match exactly the localAddress of the terminating end. Note that both ends may be originating and terminating at the same time. That is, both ends may have addressToCall and localAddress provisioned as long as addressToCall and localAddress on different ends are identical.")
mscBtdsPlcMaximumAcceptableGatewayCost = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 10, 1, 22), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 65535)).clone(2048)).setMaxAccess("readwrite")
if mibBuilder.loadTexts: mscBtdsPlcMaximumAcceptableGatewayCost.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcMaximumAcceptableGatewayCost.setDescription('This attribute indicates an upper bound on the gateway cost metric of a route, which is the sum of the gateway cost metrics of all gateway links on the route. It has the same semantics as the maximumAcceptableCost except that gateway cost metrics are used instead of trunk cost metrics. Gateway cost metrics are provisioned under Trunk Address component of a gateway link specifying a gateway costs of reaching an address through the link.')
mscBtdsPlcMpathTable = MibTable((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 262), )
if mibBuilder.loadTexts: mscBtdsPlcMpathTable.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcMpathTable.setDescription("This attribute is optional and specifies the sequence of trunks to be used as the route for the path, thus bypassing PORS' automatic route selection. If the path fails the validation, no other path can be selected1. This attribute should only be used in special cases since the route selection algorithm is able to find and maintain the best routes. A related path attribute, the pathType, determines if this route will be used as a manual or forced path type. As an example, the trunk component name for the third trunk on node MoonBase is 'EM/MoonBase Trk/3'. Note that only the first end of the trunk that the packet would encounter is provisioned. These strings are case insensitive but the complete component name must be input. Note 1: the trunk designation must be a 3-letter form, e.g., 'trk'. Note 2: only the outbound trunks component names are used to provision the manualPath. Note 3: It is recommended to have two independent routes specified for a manual path by specifying a different manualPath (non-symmetric) for each end. In this case, there is no way to select which route will be used (first up wins) but if one path is torn down due to a failure then the other manualPath may be used to reroute the path.")
mscBtdsPlcMpathEntry = MibTableRow((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 262, 1), ).setIndexNames((0, "Nortel-MsCarrier-MscPassport-BitTransparentMIB", "mscBtdsIndex"), (0, "Nortel-MsCarrier-MscPassport-BitTransparentMIB", "mscBtdsPlcIndex"), (0, "Nortel-MsCarrier-MscPassport-BitTransparentMIB", "mscBtdsPlcMpathIndex"))
if mibBuilder.loadTexts: mscBtdsPlcMpathEntry.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcMpathEntry.setDescription('An entry in the mscBtdsPlcMpathTable.')
mscBtdsPlcMpathIndex = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 262, 1, 1), Integer32().subtype(subtypeSpec=ValueRangeConstraint(0, 9)))
if mibBuilder.loadTexts: mscBtdsPlcMpathIndex.setStatus('mandatory')
if mibBuilder.loadTexts: mscBtdsPlcMpathIndex.setDescription('This variable represents the mscBtdsPlcMpathTable specific index for the mscBtdsPlcMpathTable.')
mscBtdsPlcMpathValue = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 81, 3, 262, 1, 2), AsciiString().subtype(subtypeSpec=ValueSizeConstraint(0, 40))).setMaxAccess("readwrite")
